Here's how you can implement the function:

```python
def my_func(input1: str):
    words = input1.split(" ")
    result = []
    for word in words:
        if len(word) < 5:
            result.append(word)
        else:
            result.append(word[::-1])
    return " ".join(result)
```

This function splits the input string by spaces to handle each word separately. It then checks the length of each word. If the word is shorter than five characters, it leaves the word unchanged. Otherwise, it reverses the word and adds it to the result list. Finally, it joins the list of words back into a single string with spaces in between.
